import { Navbar, Nav, NavDropdown, Button } from 'react-bootstrap';
import AdminStyleSheet from '../style-sheets/adminStyleSheet';


const AdminToolbar = () => (
  <div>
    <Navbar collapseOnSelect expand="lg" style={AdminStyleSheet.background} variant="dark">
      <Navbar.Brand href="/" className="mr-auto">Muhalik</Navbar.Brand>
      <Navbar.Brand href="#home" className="mr-auto">Admin Dashboard</Navbar.Brand>
      <Nav>
        <NavDropdown title="Setting" id="basic-nav-dropdown" split alignRight>
          <div className="hover">
            <NavDropdown.Item href="#action/3.1">Acount Setting</NavDropdown.Item>
          </div>
          <div className="hover">
            <NavDropdown.Item href="#">Send Feedback</NavDropdown.Item>
          </div>
          <div className="spliter_hover">
            <NavDropdown.Item href="#a">Help?</NavDropdown.Item>
          </div>
          <NavDropdown.Divider />
          <div className="hover">
            <NavDropdown.Item href="#b" prefixes={{ btn: 'super_btn' }}>Signout</NavDropdown.Item>
          </div>
        </NavDropdown>
      </Nav>
    </Navbar>
    <style jsx>
      {`
        .hover:hover {
          margin-left: 10px;
          margin-right: -10px;
          margin-bottom: 5px;
          margin-top: -5px;
          background: red;
      }        
      .spliter_hover:hover {
        margin-left: 10px;
        margin-right: -10px;
        margin-bottom: 13px;
        margin-top: -5px;
        background: red;
    }
    .super_btn {
      background: red;
    }
     `}
    </style>
  </div>
);

export default AdminToolbar;

{/* 563D7C E35300 */ }
